import React from 'react'

const Profile = () => {

  const date = new Date();
  const res = date.toLocaleTimeString()
  const dis = setInterval((()=>{res}),1000)

  return (
    <div style={{backgroundColor:'black',height:'100vh', width:'100vw',color:'white',textAlign:'center',display:'flex', justifyContent:'center',alignItems:'center'}} >
      <div style={{border:'1px solid yellow'}}>{dis}</div>
    </div>
  )
}

export default Profile
